import axios from "axios";
import { INSERIR_CONTATO } from "./types";

export const inserirContato = formData => async dispatch => {
  try {
    const response = await axios.post("/api/contato/inserir", formData);
  } catch (error) {
    console.log(error.message);
    res.status(500).json("Server Error");
  }
};
